package com.sajansthapit.mytodolist.models;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Id;import jakarta.persistence.Table;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;@Getter@Setter@Entity@Builder@NoArgsConstructor@AllArgsConstructor@Table(name = "status")public class Status extends BaseModel{    @Id    private String id;    @Column(name = "status", unique = true, nullable = false)    private String name;}